import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import TextField from '@material-ui/core/TextField';
import Slider from '@material-ui/core/Slider';
import Typography from '@material-ui/core/Typography';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles((theme) => ({
    formControl: {
      margin: theme.spacing(1),
      minWidth: 120,
      width:350,
    },
    table: {
      minWidth: 650,
    },
  }));

function valuetext(value) {
    return `${value}Â°C`;
}

const marks = [
    {
      value: 0,
      label: '0',
    },
    {
        value: 10,
        label: '10',
      },
    {
      value: 20,
      label: '20',
    },
    {
        value: 30,
        label: '30',
      },
    {
      value: 40,
      label: '40',
    },
    {
        value: 50,
        label: '50',
      },
    {
      value: 60,
      label: '60',
    },
  ];


  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }

  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];


const Calcul = () => {
 const classes = useStyles();
 return (
    <div>
      <Typography edge="start" variant="h4" className={classes.title}>
         Calcul du profil de plongÃ©e
      </Typography>      
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">Taille de la bouteille</InputLabel>
        <Select native defaultValue="" id="grouped-native-select">
          <option aria-label="None" value=""></option>
          <option aria-label="None" value="9">9</option>
          <option aria-label="None" value="12">12</option>
          <option aria-label="None" value="15">15</option>
          <option aria-label="None" value="18">18</option>

        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>

        <TextField id="standard-basic" label="Pression de la bouteille (en bars)" defaultValue="200"/>
      </FormControl>
      <FormControl className={classes.formControl}>

      <Typography id="discrete-slider" gutterBottom>
        Temperature
      </Typography>
      <Slider
        defaultValue={0}
        getAriaValueText={valuetext}
        aria-labelledby="discrete-slider"
        valueLabelDisplay="auto"
        step={1}
        marks
        min={0}
        max={63}
        marks={marks}
      />
      </FormControl>
      <FormControl className={classes.formControl}>

        <TextField with={500} id="standard-basic" label="DurÃ©e de la plongÃ©e avant remontÃ©e (mins)"/> 
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="grouped-native-select">Choix de la table</InputLabel>
        <Select native defaultValue="" id="grouped-native-select">
          <option aria-label="None" value=""></option>
          <option aria-label="None" value="0">Buhlman</option>
          <option aria-label="None" value="1">MN90</option>


        </Select>
      </FormControl>
      <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Dessert (100g serving)</TableCell>
            <TableCell align="right">Calories</TableCell>
            <TableCell align="right">Fat&nbsp;(g)</TableCell>
            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
            <TableCell align="right">Protein&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  );
}

export default Calcul;
